import { Alert, Button, ButtonGroup, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, IconButton, Paper, Snackbar, Typography } from "@mui/material"
import { Box } from "@mui/system"
import CloseIcon from '@mui/icons-material/Close';
import React, { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import style from './CriarGrt.module.scss';

export const SolicitarGrt = ({ loginUser }) => {

    const [open, setOpen] = useState(false);
    const [op, setOp] = useState(false);

    const abrirDialogo = () => { setOpen(true); };
    const fecharDialogo = () => { setOpen(false); };
    const abrirAviso = () => { setOp(true); };
    const fecharAviso = () => { setOp(false); };

    const [quantidade, setQuantidade] = useState(0)

    const [valor, setValor] = useState(quantidade * 1.5)

    useEffect(() => {
        setValor(quantidade * 1.5)
    }, [quantidade])

    const valorPadrão = 1.50;

    const action = (
        <React.Fragment>
            <Button color='secondary' size="small" onClick={fecharAviso}>
                Fechar
            </Button>
            <IconButton
                size="small"
                aria-label='close'
                color='inherit'
                onClick={fecharAviso}
            >
                <CloseIcon fontSize='small' />
            </IconButton>
        </React.Fragment>
    );

    const Solicitar = (e) => {
        e.preventDefault()
        const d = new Date();

        let GRT = {
            quantidade,
            valor,
            hora: Intl.DateTimeFormat('pt-BR', { hour: 'numeric', minute: 'numeric', second: 'numeric' }).format(d),
            data: Intl.DateTimeFormat('pt-BR', { dateStyle: 'full' }).format(d)
        }
        console.log(GRT)
        fecharDialogo()
        abrirAviso()
        // axios.post('http://192.168.15.49:3005/grt/solicitar', { loginUser, GRT })
        //     .then(res => {
        //         console.log(res)
        //         fecharDialogo()
        //     })
        //     .catch(err => {
        //         console.log(err)
        //     })
    }

    return (
        <>
            <Snackbar
                open={open}
                autoHideDuration={6000}
                onClose={fecharDialogo}
                // message="Note archived"
                // action={action}
            >
                <Alert onClose={fecharDialogo} severity='success' sx={{ width: '100%'}} >
                    teste
                </Alert>
            </Snackbar>
            <Dialog
                open={open}
                onClose={fecharDialogo}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">
                    Confirmar a solicitação das GRTs
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        Ao confirmar a solicitação será cobrado o valor de R$: {valor.toFixed(2)} pela
                        quantidade de {quantidade} GRTs solicitadas.
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={(e) => Solicitar(e)} color='success' autoFocus>Confirmar</Button>
                    <Button onClick={fecharDialogo} color='error'>
                        Cancelar
                    </Button>
                </DialogActions>
            </Dialog>
            <Typography variant='h6' color='primary'> Solicitar GRT</Typography>
            <Box sx={{ width: '100%' }}>
                <Paper sx={{ p: 4, m: 2 }} elevation={6} >
                    <Typography variant="h5">Valor por GRT: R$ {valorPadrão.toFixed(2)} </Typography>
                    <br /><br />
                    <Typography sx={{ p: 2 }} variant='h6'>Quantidade de GRTs:  {quantidade} </Typography>
                    <Typography sx={{ p: 2 }} variant='h6'>Valor total da GRT: R$ {valor.toFixed(2)} </Typography>
                    <div className={style.listabotaocalc}>
                        <ButtonGroup variant="contained" aria-label='qtd_grt_50' >
                            <Button onClick={() => setQuantidade(quantidade + 50)}>+ 50</Button>
                            <Button disabled={quantidade <= 75} onClick={() => setQuantidade(quantidade - 50)}>-50</Button>
                        </ButtonGroup>
                    </div>
                    <br /><br />
                    <Button sx={{ left: 1 }} onClick={() => abrirDialogo()} >Solicitar</Button>
                </Paper>
            </Box>
        </>
    )
}
